import { Component } from "react";
import Datosingreso from "./datos-ingreso";

class Ingresos extends Component{
    componentDidUpdate(){
        document.title='Ingresos'
    }

    render(){
        return(
            <div className="Ingreso">
                <h1>Ingresos</h1>
                <Datosingreso id={this.props.id}/>
            </div>
        )
    }
}

export default Ingresos;
